(13429, 'A588AFE4-07E4-4A26-90BC-FB4E97986187', 'Just a morning text to say how much IÔ∏è adore you. IÔ∏è really appreciate that you came in swiftly with an acknowledgment of the video after IÔ∏è shared it. And IÔ∏è‚Äôm sorry IÔ∏è reacted badly. IÔ∏è really do appreciate how much you take my needs into heart. And IÔ∏è always want to do the same for you. IÔ∏è love you to pieces.', 'Nitzan', 'David', '2020-10-27T09:34:09.969326'),
