(13442, '61AC6A26-AF71-4CDC-BBDF-576D5FC154B4', 'Thank you love. I adore you too and feel so happy going to sleep next to you every night and waking up to you every morning. It does feel weird though to have other people waking up with us (virtually!)  I can‚Äôt fulfill all of your needs...and you can‚Äôt fulfill all of mine. And that is okay. We know this and .... now what? I just felt bad when you said you need to look elsewhere...I felt like a disappointment to you and myself. The only way through seems like having more processing conversations right now.  This feels a bit like climbing a new mountain. Is this the second mountain in relationships?  ', 'David', 'Nitzan', '2020-10-27T11:25:26.171180'),
(13443, '86C4AAC8-1AC1-490B-9C73-3868DA017478', 'On dog. I‚Äôm scared of losing the small bits of free time that we are just now carving out for ourselves. I can do it for puppy months, but past that....I dunno. ', 'David', 'Nitzan', '2020-10-27T11:27:04.907223'),
(13508, '1C6A263B-43C7-4522-986A-12838F4ADFEB', 'Trying to process a bunch of what I have been turning over in my mind and discussed in therapy. ..... here is some processing that I just want to capture. Part of me doesn‚Äôt believe that you fully appreciate how badly your betrayal has hurt me and how angry and sad I feel....much of the time. I appreciate that you see your role as kinda ‚Äútaking it‚Äù when I get angry toward you. But a moment that stands out to me is when I asked you last night what you were working on, your first response was your body image issues, and then after a long pause, what drove you to seek attention elsewhere (I might not be accurately recalling your exact words).....in that order. I don‚Äôt see or feel you struggling with your behavior. It seems like the answer was that because I couldn‚Äôt meet your needs, and being honest with me was too risky, that you just needed to act the way you did. You realize that this was selfish and hurtful. But  I don‚Äôt think if we had to replay this movie again, that anything has changed in you that would make for a different outcome. The change has been with me....which is what had been diagnosed as the problem. And this is one of the reasons,  I don‚Äôt feel on some level that you are getting it. I‚Äôm struggling to push myself, to figure out how to be generous and let you speak with the people with whom you betrayed you, to try and be better to meet your needs and be emotionally more responsive. It‚Äôs too much to ask of me right now....which is why I got pissed last night when you turned it back to vocalizing your needs, after I recognized how I could have acted better, apologized, wrote a note and then instead of being appreciated for that...and for the help for your video shoot taking care of the Climbers (and Orli), the multiple rounds of feedback, putting up with loud editor calls at 7:30 in bed....heard your insight on why you seek the affirmation/attention elsewhere. It made me wish I had never spend a second of my time and energy helping you.  I also don‚Äôt appreciate your need to control who and how I speak to people about what has been going on, like Dan. You weren‚Äôt honest with him. You told him half the story so you wouldn‚Äôt look bad and maybe  feel a bit of pity/empathy toward me. I couldn‚Äôt let that stand. This isn‚Äôt your narrative to control.   I‚Äôm trying to process a lot right now. But if I can be honest, I need to feel appreciated and loved by you, and not focused on how I can better be meeting your needs right now. I feel deeply hurt and sad and I‚Äôm trying to rush to make it feel better, because I don‚Äôt want to feel this way. So I‚Äôm turning myself inside out, trying to get input and feedback from others, and trying to give you what you need. I don‚Äôt feel you struggling in the same way.   And it feels, in a word, selfish. Which is the behavior that got us here in the first place.', 'David', 'Nitzan', '2020-10-27T15:55:50.707000'),
